Secrets of South America

Travel Documentary hosted by Billie JD Porter, published by BBC in 2014 - English narration


Information
------------------------------

Secrets of South America
Three-part series revealing what it's like to be young in South America.


1)  Extreme Beauty Queens 
In the first edition of her exploration of South American cultural quirks, Billie JD Porter visits the Miss Venezuela boot camp, where young women are trained to become beauty queens under the tutelage of the `King of Beauty' Osmel Sousa. She meets a 20-year-old farm girl who has given up university to focus on the competition, and an 18-year-old whose family works seven days a week to pay for the cosmetic surgery she requires to succeed and escape the slums in which she lives.

2)  Generation Sex 
Billie JD Porter travels to Argentina to unlock the hidden world of one of the country's biggest passions - sex. Arriving in Buenos Aires only days before the Dia de la Primavera festival, which celebrates the first day of spring, she finds signs of sex everywhere, from the music and the partying to the steady stream of customers visiting `Telos', or love hotels. However, it also proves to be a country of contradictions, where such freedoms run up against the power of the Catholic Church.

3)  Cinderellas of the Slums 
In the last of three programmes revealing what it's like to be young in South America, Billie JD Porter travels to Brazil to explore the glitz and glamour of 15th birthday debutante balls. In Brazil's booming economy, some parents are spending more than Ã‚Â£100,000 on their daughter's special day. But in a country with a huge gap between rich and poor, not everyone is invited to the party. Billie teams up with two modern-day 'Cinderella's' who are hoping their dreams of making it to the ball will come true.

